import React, { useState } from 'react';
import './style.css';


export default function CardSetCard(props) {

    function handleClick() {
        console.log("Clicked");
    }

    return (
        <div className={`setCard `}
             onClick={() => handleClick()}>
            <div className="front">
                {props.name}
            </div>
        </div>
    )
}
